int TeamInfo(const char* pszName, int iSize, void* pbuf)
{
	if (g_Vars.LocalCheck)
	{
		BEGIN_READ(pbuf, iSize);

		cl_entity_s* Entity = g_Engine.GetLocalPlayer();

		int Index = READ_BYTE();
		char* Team = READ_STRING();
		cl_entity_s* localPlayer = g_Engine.GetLocalPlayer();
		if (!lstrcmpiA(Team, "C"))
		{
			if (Index == g_Local.ent->index) g_Local.Team = 2;
			else				   g_LocalPlayer[Index].Team = 2;
		}
		else if (!lstrcmpiA(Team, "T"))
		{
			if (Index == g_Local.ent->index) g_Local.Team = 1;
			else				   g_LocalPlayer[Index].Team = 1;
		}
		else
			g_LocalPlayer[Index].Team = 0;
	}
	return pTeamInfo(pszName, iSize, pbuf);
}

